import React from 'react';
import { NavLink } from 'react-router-dom';
import './sidebar.scss';

const SideBar: React.FC = () => {
    return (
        <nav className="bg-light sidebar flex-shrink-0 sidebar-open" id="sidebar" aria-label="side navigation">
            <div className="bg-light sidebar-inner small-scrollbar">
                <ul className="nav flex-column flex-nowrap overflow-hidden">
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/trainers">
                            Players
                        </NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" to="/trainers/inactive">
                            Inactive Players
                        </NavLink>
                    </li>
                </ul>
            </div>
        </nav>
    );
};

export default SideBar;
